import {Modal, Button} from 'react-bootstrap';
import './CheckModal.css';

const CheckModal=(props)=>{
    return(
        <Modal
        {...props}
        size="lg"
        aria-labelledby="contained-modal-title-vcenter"
        centered
        >
            <Modal.Header>
                <Modal.Title className='checktitle' id="contained-modal-title-vcenter">
                선택한 위치에 방을 만드시겠습니까?
                </Modal.Title>
            </Modal.Header>

            <Modal.Body>
                <p className='checkbody'>
                현재 선택한 마커의 위치에 방이 만들어집니다.
                </p>
            </Modal.Body>

            <Modal.Footer>
                <Button className='checkbutton' onClick={props.onHide}>취소</Button>
                <Button className='checkbutton' onClick={props.onHide}>확인</Button>
            </Modal.Footer>
        </Modal>
    );
}

export default CheckModal;
